          <p><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">针对文书类型的筛选</span></p><p><span style="font-family:'ArialMT', 'Arial', sans-serif;">1</span><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">、对原有的类型名称进行调整</span></p><ul><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">强制文书——实施行政强制措施决定书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">处罚告知——行政处罚告知书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">处罚决定——行政处罚决定书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">当场处罚——当场行政处罚决定</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">立案——立案审批表</span></li></ul><p><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;"><br></span></p><p><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;"><br></span></p><p><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">2、新增多个取号的类型：</span></p><ul><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">责令改正通知书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">询问通知书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">先行登记保存证据通知书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">延长行政强制措施期限决定书</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">案件移送函</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">行政处罚文书送达公告</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">协助调查函</span></li><li style=""><span style="font-family:'PingFangSC-Regular', 'PingFang SC', sans-serif;">责令退款通知书</span>
